import React from 'react';
import './Menu.css';

// Pass in "GET" categories. Run forEach loop to print out "li"s for them
const Menu = () => {
    return (
        <div className="menu">
            <ul className="menu-list">
                <form>
                </form>
                    <p className="menu-label">
                    </p>
                    <li>
                        <a href="">
                            <span class="menu-icon"></span>
                            Discover
                        </a>
                    </li>
                    <li>
                        <a href="">
                            <span class="menu-icon"></span>
                            Popular
                        </a>
                    </li>
                    <p class="menu-label">Categories</p>
                    <li>Arts</li>
                    
            </ul>
        </div>
    );
}

export default Menu;
